import { Navigate } from 'react-router-dom';

const PublicRoute = ({ element, ...rest }) => {
  const isLoggedIn = localStorage.getItem('isLoggedIn');

  if (isLoggedIn) {
    return <Navigate to="/" />;
  }

  return element;
};

export default PublicRoute;
